import React from "react";
import { Link, useLocation } from "react-router-dom";
import Logo from "../../assets/logo.png";

const Navfooter = () => {
  const lienActif = useLocation();
  return (
    <div className="headerlogo">
      <img src={Logo} className="Logo" alt="Logo"/>
      <nav className="footernav">
        <a href="https://www.instagram.com/commeospa/" target="_blank">
          <img src="https://i.goopics.net/dmxubf.png" className="instafooter" alt="Instagram" />
        </a>
        <Link>Télécharger ma carte de visite</Link>
        <Link to="/Mentions"className={`link ${lienActif.pathname === '/M' ? 'actif' : ''}`}>Mentions légales</Link>
      </nav>
    </div>
  );
};

export default Navfooter;
